import bgHome from '../img/bg home.png'
import stileHome from './HomePage.module.css'

const HomePage = (props) => {
return(
<>
<div className="container-fluid p-0">
<img src={bgHome} className="d-flex d-lg-none img-fluid" alt="sfondo-home"></img>
<img src={bgHome} className="d-none d-lg-flex img-fluid" alt="sfondo-home"></img>
</div>
<div className='d-flex justify-content-center my-4 mx-2 text-center'>
<h2 className={stileHome.stileTitle}>STATISTICHE SUL CALCIO DA TUTTO IL MONDO</h2>
</div>
<LinkHome
changeActive={props.changeActive}
></LinkHome>
</>
)};

